import { HOMEPAGE_PATH } from "@/url/web-url";

const HomepageView = import(/* webpackChunkName: "homepage-view" */ "./HomepageView");

// eslint-disable-next-line import/no-anonymous-default-export
export default {
  path: HOMEPAGE_PATH,
  element: HomepageView,
};
